        if item['category'] == 'Investment income':
            investment_income += item['number_value']
            investment_income_count += 1
        elif item['category'] == 'Financing costs':
            financing_costs += item['number_value']
            financing_costs_count += 1

    if investment_income_count > 0:
        avg_investment_income = investment_income / investment_income_count
    else:
        avg_investment_income = 0

    if financing_costs_count > 0:
        avg_financing_costs = financing_costs / financing_costs_count
    else:
        avg_financing_costs = 0

    difference = avg_investment_income - avg_financing_costs

    return (float(f"{difference:.2f}"), "")

